import React, { useState } from 'react';
import { Helmet } from 'react-helmet';
import { Link, useNavigate } from 'react-router-dom';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!email || !password) {
      setError("Please fill in all fields.");
      return;
    }
    // Simulate login success
    navigate('/dashboard');
  };

  return (
    <div>
      <Helmet>
        <link 
          rel="stylesheet" 
          href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" 
        />
      </Helmet>
      <nav className="navbar navbar-expand-md sticky-top py-3 navbar-dark bg-dark">
        <div className="container">
          <Link className="navbar-brand" to="/">Brand</Link>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav mx-auto">
              <li className="nav-item">
                <Link className="nav-link active" to="/login">Log in</Link>
              </li>
            </ul>
            <Link className="btn btn-primary shadow" to="/signup">Sign up</Link>
          </div>
        </div>
      </nav>
      <section className="py-5">
        <div className="container py-5">
          <h2 className="text-center">Welcome Back</h2>
          {error && <p className="text-danger text-center">{error}</p>}
          <div className="row justify-content-center">
            <div className="col-md-6 col-xl-4">
              <form onSubmit={handleSubmit}>
                <div className="mb-3">
                  <input 
                    className="form-control" 
                    type="email" 
                    value={email} 
                    onChange={(e) => setEmail(e.target.value)} 
                    placeholder="Email" 
                    required 
                  />
                </div>
                <div className="mb-3">
                  <input 
                    className="form-control" 
                    type="password" 
                    value={password} 
                    onChange={(e) => setPassword(e.target.value)} 
                    placeholder="Password" 
                    required 
                  />
                </div>
                <button className="btn btn-primary w-100" type="submit">Log in</button>
              </form>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Login;
